var wasDataService = null;
var userService = null;
var onOpenCoronaCallback = null;
var onCloseCoronaCallback = null;
const wickeyappstore = document.querySelector('wickey-appstore');
wickeyappstore.addEventListener('open', (event) => {
    if (onOpenCoronaCallback !== null) {
        onOpenCoronaCallback()
    }
    // https://forums.coronalabs.com/topic/73492-html5-plugin-keyboard-input/
    // disable SDL keyboard handler and enable native JS handler
    var jsEnableKeyboard = Module.cwrap('jsEnableKeyboard', 'null', ['number']);
    jsEnableKeyboard(0);

    var _openTimer
    function _checkIfWASOpen() {
        // Check if cdk-overlay-backdrop-showing is on page
        var WASisOpen = document.getElementsByClassName('cdk-overlay-backdrop-showing');
        if (WASisOpen.length === 0) {
            // enable SDL keyboard handler and disable native JS handler
            jsEnableKeyboard(1);
            clearTimeout(_openTimer);
            if (onCloseCoronaCallback !== null) {
                onCloseCoronaCallback()
            }
        } else {
            _openTimer = setTimeout(_checkIfWASOpen, 300);
        }
    }
    _openTimer = setTimeout(_checkIfWASOpen, 1000);
    
});

function onSaveConflict(localSave, cloudSave) {
    let keepSave = localSave;
    if (localSave && cloudSave) {
        if (cloudSave.highScore > localSave.highScore) {
            keepSave = cloudSave;
        }
    }
    return keepSave;
}
