var isLoadedTimer;
window.wickeyappstore_js = {
    onOpen: function( callbackReference ) {
        if( LuaIsFunction( callbackReference ) ) {
            onOpenCoronaCallback = LuaCreateFunction( callbackReference );
        }
    },
    onClose: function( callbackReference ) {
        if( LuaIsFunction( callbackReference ) ) {
            onCloseCoronaCallback = LuaCreateFunction( callbackReference );
        }
    },
    onLoad: function(callbackReference) {
        if( LuaIsFunction( callbackReference ) ) {
            var _loadCallback = LuaCreateFunction( callbackReference );
            function _checkIfLoaded() {
                if (window.WAS == undefined || window.WAS == null) {
                    isLoadedTimer = setTimeout(_checkIfLoaded, 1000);
                } else {
                    console.log('wickeyappstore_js module loaded', window.WAS);
                    wasDataService = window.WAS.dataService;
                    userService = window.WAS.userService;
                    clearTimeout(isLoadedTimer);
                    _loadCallback();
                    LuaReleaseFunction(_loadCallback);
                }
            }
            isLoadedTimer = setTimeout(_checkIfLoaded, 1000);
        }
    },
    user: function( callbackReference ) {
        if( LuaIsFunction( callbackReference ) ) {
            var _usrCallback = LuaCreateFunction( callbackReference );
            userService.user.subscribe((usr) => {
                _usrCallback(usr);
                // LuaReleaseFunction(_usrCallback);
            }, (error) => {
                console.log(`get user: error`, error);
                _usrCallback(null);
                // LuaReleaseFunction(_usrCallback);
            });
        }
    },
    updateUsername: function( _username, callbackReference ) {
        if( LuaIsFunction( callbackReference ) ) {
            var _usrnameCallback = LuaCreateFunction( callbackReference );
            userService.updateUsername(_username).subscribe((usr) => {
                _usrnameCallback(usr);
                // LuaReleaseFunction(_usrnameCallback);
            }, (error) => {
                _usrnameCallback({error: error});
                // LuaReleaseFunction(_usrnameCallback);
            });
        }
    },
    loginChange: function( callbackReference ) {
        if( LuaIsFunction( callbackReference ) ) {
            var _logCallback = LuaCreateFunction( callbackReference );
            userService.loginChange.subscribe((_isLogged) => {
                _logCallback(_isLogged);
                // LuaReleaseFunction(_logCallback);
            }, (error) => {
                _logCallback(null);
                // LuaReleaseFunction(_logCallback);
            });
        }
    },
    getLeaderboard: function( callbackReference ) {
        if( LuaIsFunction( callbackReference ) ) {
            var _leaderCallback = LuaCreateFunction( callbackReference );
            userService.getLeaderboard(userService.userObject.username).subscribe(res => {
                // res.leaderboard; res.rank;
                _leaderCallback(usr);
                // LuaReleaseFunction(_leaderCallback);
            }, (error) => {
                console.log(`get user: error`, error);
                _leaderCallback(null);
                // LuaReleaseFunction(_leaderCallback);
            });
        }
    },
    submitHighscore: function(_val) {
        userService.setHighscore(_val);
    },
    dataRestore: function( callbackReference, onSaveConflictRef ) {
        if( LuaIsFunction( callbackReference ) ) {
            var _restCallback = LuaCreateFunction( callbackReference );
            var _onSaveConflict = onSaveConflict;
            var isLuaConflict = false;
            if (onSaveConflictRef && LuaIsFunction( callbackReference )) {
                _onSaveConflict = LuaCreateFunction( onSaveConflictRef );
                isLuaConflict = true;
            }
            wasDataService.restore(_onSaveConflict).subscribe(mydata => {
                // initRestored = true;
                _restCallback(mydata);
                // LuaReleaseFunction(_restCallback);
                // if (isLuaConflict) {
                //     LuaReleaseFunction(_onSaveConflict);
                // }
            }, (error) => {
                _restCallback(null);
                // LuaReleaseFunction(_restCallback);
                // if (isLuaConflict) {
                //     LuaReleaseFunction(_onSaveConflict);
                // }
            });
        }
    },
    dataSave: function(_key, _val) {
        wasDataService.save(_key, _val);
    },
    dataGet: function(_key) {
        return wasDataService.get(_key);
    },
    dataPersist: function() {
        wasDataService.persist();
    },
};